import React from "react";
import styled from "styled-components";

const NavbarTemplate = styled.div``;

const NavbarContainer = styled.div`
  max-width: 1280px;
  height: 120px;
  margin: 0 auto;
  display: flex;
  justify-content: space-between;
  align-items: center;
  padding-left: 40px;
  padding-right: 40px;
  z-index: 3;
  background: #fff;
`;

const NavECText = styled.span`
  display: inline-block;
  font-size: 1.5rem;
  color: #101010;
  font-weight: bold;
  white-space: nowrap;
`;

const NavMenu = styled.ul`
  padding: 0;
  margin: 0;
  display: flex;
  list-style: none;
  li:not(:nth-child(1)) {
    padding-left: 32px;
  }
  li:nth-child(4) {
    opacity: 0.2;
  }
`;

const NavMenuText = styled.li`
  a {
    text-decoration: none;
    color: #101010;
  }
`;

const Nav_Toggle = styled.a`
  position: absolute;
  right: 80px;
  span:nth-child(1) {
    top: -5px;
  }
  span:nth-child(2),
  span:nth-child(3) {
    top: 5px;
  }
  span:nth-child(4) {
    top: 15px;
  }
`;
const Nav_ToggleBtn = styled.span`
  position: absolute;
  transition: 0.3s ease-in-out;
  height: 4px;
  width: 30px;
  border-radius: 7px;
  background-color: #3d4146;
  top: 0;
  transition: 0.3s;
`;

function Main_Navbar() {
  return (
    <NavbarContainer>
      <NavECText>Endless Creation</NavECText>
      <NavMenu>
        <NavMenuText>
          <a href="#">Activity</a>
        </NavMenuText>
        <NavMenuText>
          <a href="#">Project</a>
        </NavMenuText>
        <NavMenuText>
          <a href="#">Member</a>
        </NavMenuText>
        <NavMenuText>
          <a href="#">community</a>
        </NavMenuText>
      </NavMenu>
      <Nav_Toggle>
        <Nav_ToggleBtn />
        <Nav_ToggleBtn />
        <Nav_ToggleBtn />
        <Nav_ToggleBtn />
      </Nav_Toggle>
    </NavbarContainer>
  );
}

export default Main_Navbar;
